const interpretRule = ruleString => {
  const ruleParts = ruleString.split(' ')
  const minMaxParts = ruleParts[0].split('-')
  return {
    character: ruleParts[1],
    min: parseInt(minMaxParts[0], 10),
    max: parseInt(minMaxParts[1], 10)
  }
}

const countCharacters = (string, chars) => string.split(chars).length - 1

const first = passwords.filter(password => {
  const rule = interpretRule(password.rule)
  const count = countCharacters(password.value, rule.character)
  return count >= rule.min && count <= rule.max
}).length

